import React  from 'react'
import service from './DataService'
const handleClick=(id , setPersons)=>{
  service.del(id).then(data=>{
    service.getAll().then(data => setPersons(data) )
  })
}
const Number=(props)=>{
    console.log(props)
    const getNames =() => props.persons.filter(p => props.smode==='n'?true:p.name.toLowerCase()===props.searchString.toLowerCase()).map((p)=> <li key={p.id}>{p.name} {p.number} <button onClick={handleClick(p.id,props.setPersons)}/></li>)
    return ( 

      <ul>{getNames()}</ul>

    )
  }

  export default Number
